description:
For those too busy to take traditional off-site classes will appreciate the fact that the self-study PMI PMP CBT program is self-paced and self-guided, thus allowing you to schedule time for learning at your own convenience. Take control of your own learning destiny with our course since it allows you the complete freedom to learn on your own terms since you learn from your computer and PMP training CDs. You never have to set foot at an offsite location since the self-paced PMI PMP computer based training videos can be conveniently taken from the comforts of your home or office. 

No installation required. Just double-click the .exe file and your videos should play.

